function IncomeTax(Income) {
    if (Income <= 400000) {
        document.getElementById("taxable_income").value = 0;
        return;
    }
    let taxable_amount = 0;

    if(income <= 300000){
        taxable_amount = (income - 150000) * 0.025;
    }
    else if (income <= 800000) {
        taxable_amount = (income - 300000) * 0.10 + 3750;
    } 
    else if (income <= 10000000){
        taxable_amount = (income - 800000) * 0.25 + 53750; 
    }
    else {
        taxable_amount = (income - 10000000) * 0.30 + 2353750
    }
    document.getElementById("taxable_income").value = taxable_amount;
}


function GrossIncome(net_Income) {
    if (net_Income <= 400000) {
      document.getElementById("calculated_gross").value = net_Income;
      return;
    }
    let gross_Income = 0;
    
    gross_Income += 150000;
    net_Income -= 150000;
  
    gross_Income += 150000;
    net_Income -= 146250;
  
    if (net_Income <= 450000) {
        gross_Income += net_Income/0.9;
        document.getElementById("calculated_gross").value = Math.floor(gross_Income);
        return;
    } else {
        net_Income -= 450000;
        gross_Income += 500000;
    }
  
    if (net_Income <= 6900000) {
        gross_Income += net_Income/0.75;
        document.getElementById("calculated_gross").value = Math.floor(gross_Income);
        return;
    } else {
        net_Income -= 6900000;
        gross_Income += 92000000;
    }
  
    gross_Income += net_Income/0.7;
    document.getElementById("calculated_gross").value = Math.floor(gross_Income);
    return;
  }

