function calcIncomeTax(grossIncome) {
    if (grossIncome <= 400000) {
        document.getElementById("tax").value = 0;
        return;
    }
    let amount = grossIncome;
    let tax = 0;
    if (amount > 10000000) {
        tax += (amount - 10000000) * 0.3;
        amount = 10000000;
    }
    if (amount > 800000) {
        tax += (amount - 800000) * 0.25;
        amount = 800000;
    }
    if (amount > 300000) {
        tax += (amount - 300000) * 0.1;
        amount = 300000;
    }
    tax += (amount - 150000) * 0.025;
    amount = 150000;
    document.getElementById("tax").value = tax;
}

