function calcGrossIncome(netIncome) {
  if (netIncome <= 400000) {
    document.getElementById("gross_income_op").value = netIncome;
    return;
  }
  let grossIncome = 0;
  
  grossIncome += 150000;
  netIncome -= 150000;

  grossIncome += 150000;
  netIncome -= 146250;

  if (netIncome <= 450000) {
      grossIncome += netIncome/0.9;
      document.getElementById("gross_income_op").value = Math.floor(grossIncome);
      return;
  } else {
      netIncome -= 450000;
      grossIncome += 500000;
  }

  if (netIncome <= 6900000) {
      grossIncome += netIncome/0.75;
      document.getElementById("gross_income_op").value = Math.floor(grossIncome);
